def aes_encrypt(text, key):
    text = text.encode()
    pad = 16 - len(text) % 16
    text += chr(pad).encode() * pad
    aes = AES.new(key.encode(), AES.MODE_CBC, '0102030405060708'.encode())
    result = aes.encrypt(text)
    return base64.b64encode(result).decode()


